package edu.auburn.eng.csse.COMP3710.Group_22.lost_chronicle;

public class Attribute {
	private int mAttack;
	private int mDefence;
	private int mDodge;
	private int mHealth;
	private int mHit;
	private int mMagicDefence;
	
	public Attribute() {
		// TODO Auto-generated constructor stub
	}

	public int getAttack() {
		return mAttack;
	}

	public void setAttack(int mAttack) {
		this.mAttack = mAttack;
	}

	public int getDefence() {
		return mDefence;
	}

	public void setDefence(int mDefence) {
		this.mDefence = mDefence;
	}

	public int getDodge() {
		return mDodge;
	}

	public void setDodge(int mDodge) {
		this.mDodge = mDodge;
	}

	public int getHealth() {
		return mHealth;
	}

	public void setHealth(int mHealth) {
		this.mHealth = mHealth;
	}

	public int getHit() {
		return mHit;
	}

	public void setHit(int mHit) {
		this.mHit = mHit;
	}

	public int getMagicDefence() {
		return mMagicDefence;
	}

	public void setMagicDefence(int mMagicDefence) {
		this.mMagicDefence = mMagicDefence;
	}
	
	
}
